import React from 'react'
import { FaSpotify } from 'react-icons/fa'

export const Sidebar = () => {
    return (
        <div className='h-screen fixed w-[10rem]'>
            <div className='mt-10'>
                <FaSpotify className='w-full text-spotify-green text-[70px] rotate-90' />
            </div>
        </div>
    )
}
